        brown,
        white,
        purple,
        prismatic
    }

    event WatchersRingMinted(
        address to,
        uint256 tokenId,
        IWatchersRing.WatchersRingType rtype
    );

    function mintTokenId(
        address recipient,
        uint256 tokenId,
        WatchersRingType rtype
    ) external;
}

